INSERT INTO `eshop_availabilities` (`id`, `availability_id`, `availability_name`, `availability_description`, `creation_date`, `update_date`) VALUES
(17, '1', 'Άμεση παραλαβή / Παράδoση 1 έως 3 ημέρες', 'αφορά στα ηλεκτρονικά καταστήματα που έχουν και φυσική παρουσία. Αυτό σημαίνει πως διαθέτουν το προϊόν στο κατάστημα και υπάρχει δυνατότητα παραλαβής από το χώρο του φυσικού καταστήματος', '2021-04-26 15:07:41', '2021-04-26 15:07:41'),
(18, '2', 'Παράδοση σε 1 - 3 ημέρες', 'αφορά προϊόντα τα οποία δεν είναι άμεσα διαθέσιμα στο κατάστημα (φυσικό ή ηλεκτρονικό), αλλά ενδέχεται να είναι διαθέσιμα για αποστολή από την αποθήκη ή/και τον εκάστοτε προμηθευτή του καταστήματος', '2021-04-26 15:07:41', '2021-04-26 15:07:41'),
(19, '3', 'Παράδοση σε 4 - 10 ημέρες', 'αφορά προϊόντα τα οποία δεν είναι άμεσα διαθέσιμα στο κατάστημα, αλλά σε κάθε περίπτωση θα παραδοθούν εντός αυτού του διαστήματος', '2021-04-26 15:07:41', '2021-04-26 15:07:41'),
(20, '4', 'Παράδοση έως 30 ημέρες', 'αφορά προϊόντα τα οποία δεν υπάρχουν σε απόθεμα και παραδίδονται μόνο κατόπιν παραγγελίας. Στα προϊόντα αυτά ο χρόνος παράδοσης σε καμία περίπτωση δε μπορεί να ξεπερνάει τις 30 ημερολογιακές ημέρες, δηλαδή, το μέγιστο όριο που ορίζεται από τη νομοθεσία για το ηλεκτρονικό εμπόριο και τις πωλήσεις από απόσταση', '2021-04-26 15:07:41', '2021-04-26 15:07:41');
