(687, 2716, 23, 'ΣΑΚΙΔΙΟ ΠΛΑΤΗΣ FJALLRAVEN KANKEN BACKPACK 16L 23510-031 GRAPHITE - ΓΚΡΙ', 'https://pelina.gr/el/gynaika/-gynaikeies-tsantes/sakidiaplatis/-fjallraven-kanken-backpack-16l-23510-031-graphite-p-2716.html', '94.9', '', 'https://pelina.gr/6541/-fjallraven-kanken-backpack-16l-23510-031-graphite.jpg', 'https://pelina.gr/6541/-fjallraven-kanken-backpack-16l-23510-031-graphite.jpg', 'KANKEN FJALLRAVEN', '23510-031', '', '', 'ONE SIZE', '', 'ΓΥΝΑΙΚΑ > Τσάντα > ΣΑΚΙΔΙΑ ΠΛΑΤΗΣ', 'Το σακίδιο πλάτης Kånken κυκλοφόρησε το 1978 για να βοηθήσει στην αποφυγή προβλημάτων της πλάτης στα παιδιά που πήγαιναν σχολείο στην Σουηδία. Προβλήματα πλάτης άρχισαν αν εμφανίζονται σε νεότερες ηλικίες και τα σακίδια πλάτης ήταν δημοφιλή. Το Kånken έχει πολλές και απλές λειτουργίες.Εγινε δημοφιλές στα σχολεία της χώρας όπως επίσης και η ιδέα του σακιδίου πλάτης όπως το Kånken.Είναι μια εξαιρετική επιλογή για σχολείο,βόλτα η και εργασία.Είναι κατασκευασμένο από ανθεκτικό ,ελαφρύ  Vinylon F.Ο κεντρικός χώρος έχει ένα μεγάλο άνοιγμα  που καθιστά εύκολη την μετακίνηση των αντικειμένων.Δυο ανοιχτές πλαινές θήκες και μια θήκη με φερμουάρ μπροστά.Λαβή στο πάνω μέρος,στενοί,ευλύγιστοι ιμάντες πλάτης,προστασία στην θήκη της πλάτης και λογότυπο που λειτουργεί και ως ανακλαστικό.', '', 'Άμεση παραλαβή / Παράδοση 1 έως 3 ημέρες', '0', '1', '2021-04-27 17:02:49', '2021-04-27 17:02:49', NULL, NULL, NULL, '2021-04-22 16:14:47'),
