(824, 2969, 23, 'TIGERNU ΣΑΚΙΔΙΟ ΠΛΑΤΗΣ T-B3622 GREY - ΓΚΡΙ', 'https://pelina.gr/el/andras/tsantes/tigernu-t-b3622-grey-p-2969.html', '59.18', '', 'https://pelina.gr/7233/tigernu-t-b3622-grey.jpg', 'https://pelina.gr/7233/tigernu-t-b3622-grey.jpg', 'TIGERNU', 'T-B3622', '', '', 'Μ', '', 'ΆΝΔΡΑΣ > ΤΣΑΝΤΕΣ', 'Θέση για laptop έως 15.6\"\nΕργονομικός σχεδιασμός για να μη βαραίνει την πλάτη\nΘύρα usb\nΑντικλεπτικό φερμουάρ που δε σκίζεται\nΑνθεκτικό στο νερό και στα σκισίματα\nΜεγάλη χωρητικότητα\nKρυφή, αντικλεπτική θέση στην πλάτη\nΙμάντας βαλίτσας\n\nΔιαστάσεις:  32x17x46cm', '', 'Άμεση παραλαβή / Παράδοση 1 έως 3 ημέρες', '0', '1', '2021-04-27 17:02:50', '2021-04-27 17:02:50', NULL, NULL, NULL, '2021-04-22 16:14:47'),
(825, 2970, 23, 'TIGERNU BACKPACK T-B3105 15.6\'\' BLACK - ΜΑΥΡΟ', 'https://pelina.gr/el/andras/tsantes/tigernu-backpack-t-b3105-156-black-p-2970.html', '63.75', '', 'https://pelina.gr/7241/tigernu-backpack-t-b3105-156-black.jpg', 'https://pelina.gr/7241/tigernu-backpack-t-b3105-156-black.jpg', 'TIGERNU', 'T-B3105', '', '', 'Μ', '', 'ΆΝΔΡΑΣ > ΤΣΑΝΤΕΣ', 'TIGERNU κλασικό σχέδιο αντικλεπτικό σακίδιο\n\n \n\nΧωρητικότητα: Το σακίδιο είναι αντικλεπτικό σχέδιο με μέγεθος 29 * 14 * 45 εκατοστά. Το κύριο διαμέρισμα με πολλές τσέπες και μια ενσωματωμένη υποδοχή φορητού υπολογιστή χωράει έως και 15,6 ″ φορητό υπολογιστή. Είναι επίσης ευρύχωρο για τις καθημερινές σας ανάγκες, βιβλία, ρούχα, power bank, ακουστικά και ούτω καθεξής. Το μπροστινό διαμέρισμα με πολλαπλές τσέπες διαιρέτη βοηθά στην οργάνωση των μικρών σας αντικειμένων, στυλό, πορτοφόλι, τηλέφωνο, καλώδια κ.λπ. Μία πλαϊνή τσέπη με φερμουάρ και μία πλαϊνή τσέπη. πίσω αντικλεπτική τσέπη για σημαντικά πράγματα\n\n \n\nΧαρακτηριστικά ασφαλείας: Το σακίδιο μόδας είναι κατασκευασμένο από αδιάβροχο και ανθεκτικό στις γρατσουνιές νάιλον, ανθεκτικό και μακράς διαρκείας. Το διπλό φερμουάρ διπλού στρώματος με δίπλωμα ευρεσιτεχνίας παρέχει μαζί με το ενσωματωμένο κλείδωμα TSA παρέχει επιπλέον ασφάλεια για το ταξίδι και την καθημερινή ζωή σας. Ο ανακλαστικός ιμάντας σας κάνει πιο αισθητούς τη νύχτα\n\n \n\nΧαρακτηριστικά: Μια καλά πλεκτή ζώνη αποσκευών είναι αρκετά βολική για να στερεώσετε την τσάντα φορητού υπολογιστή στη βαλίτσα σας, καθιστώντας το ταξίδι και το ταξίδι σας πιο βολικό όπου κι αν πάτε. Με μια τρύπα USB και ακουστικών, μπορείτε να φορτίσετε το τηλέφωνό σας ή άλλες συσκευές ανά πάσα στιγμή .\n\n \n\nΑυτό το σακίδιο πλάτης είναι ένα κλασικό σχεδιασμό αντικλεπτικό σακίδιο, κατάλληλο για άνδρες, γυναίκες, μαθητές για οποιοδήποτε σκοπό. Είναι ιδανικό για καθημερινή ζωή, επιχείρηση, εργασία, ψώνια, κάμπινγκ, πικνίκ, σχολείο, ταξιδιωτικό σακίδιο.', '', 'Άμεση παραλαβή / Παράδοση 1 έως 3 ημέρες', '0', '1', '2021-04-27 17: